import React, { useState } from "react";
import {
  Container,
  TextField,
  Button,
  Checkbox,
  FormControlLabel,
  Typography,
  Link,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import logoImage from "../../images/registration/CPlogo.png";
import loginBG from "../../images/registration/loginBG5.jpg";
import "../../styles/Signup.css";
import AuthService from "../../services/registration/authentication";

const SignUp: React.FC = () => {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [isTraveller, setIsTraveller] = useState(false);
  const [isHost, setIsHost] = useState(false);
  const [successful, setSuccessful] = useState(false);
  const [message, setMessage] = useState("");
  const [errors, setErrors] = useState<{ [key: string]: string }>({});

  const navigate = useNavigate();

  const validate = () => {
    let tempErrors: { [key: string]: string } = {};

    if (!username) {
      tempErrors.username = "This field is required!";
    } else if (username.length < 4 || username.length > 20) {
      tempErrors.username = "The username must be between 4 and 20 characters.";
    }

    if (!email) {
      tempErrors.email = "This field is required!";
    } else if (!/\S+@\S+\.\S+/.test(email)) {
      tempErrors.email = "This is not a valid email.";
    }

    if (!password) {
      tempErrors.password = "This field is required!";
    } else if (password.length < 6 || password.length > 20) {
      tempErrors.password = "The password must be between 6 and 20 characters.";
    }

    setErrors(tempErrors);

    return Object.keys(tempErrors).length === 0;
  };

  const handleRegister = () => {
    if (!validate()) {
      return;
    }

    setMessage("");
    setSuccessful(false);

    AuthService.register(username, email, password).then(
      (response) => {
        setMessage(response.data.message);
        setSuccessful(true);
        // Redirect to dashboard upon successful registration
        navigate("/dashboard");
      },
      (error) => {
        const resMessage =
          (error.response &&
            error.response.data &&
            error.response.data.message) ||
          error.message ||
          error.toString();

        setSuccessful(false);
        setMessage(resMessage);
      }
    );
  };

  const handleInputChange = (setter: React.Dispatch<React.SetStateAction<string>>, field: string) => (e: React.ChangeEvent<HTMLInputElement>) => {
    setter(e.target.value);
    setErrors((prevErrors) => {
      const { [field]: removedError, ...rest } = prevErrors;
      return rest;
    });
  };

  const handleTravellerChange = () => {
    setIsTraveller(!isTraveller);
    if (!isTraveller) {
      setIsHost(false); // Disable host if traveller is selected
    }
  };

  const handleHostChange = () => {
    setIsHost(!isHost);
    if (!isHost) {
      setIsTraveller(false); // Disable traveller if host is selected
    }
  };

  return (
    <div className="root-container" style={{ backgroundImage: `url(${loginBG})` }}>
      <Container className="signup-container">
        <div className="signup-box">
          <img
            src={logoImage}
            alt="Crashpad Logo"
            style={{ width: "50%", height: "auto", marginLeft: "6em" }}
          />

          <TextField
            fullWidth
            margin="normal"
            id="username"
            label="User Name"
            variant="outlined"
            value={username}
            onChange={handleInputChange(setUsername, "username")}
            error={!!errors.username}
            helperText={errors.username}
          />
          <TextField
            fullWidth
            margin="normal"
            id="email"
            label="Email Address"
            variant="outlined"
            value={email}
            onChange={handleInputChange(setEmail, "email")}
            error={!!errors.email}
            helperText={errors.email}
          />
          <TextField
            fullWidth
            margin="normal"
            id="password"
            label="Password"
            type="password"
            variant="outlined"
            value={password}
            onChange={handleInputChange(setPassword, "password")}
            error={!!errors.password}
            helperText={errors.password}
          />

          <div className="account-type">
            <FormControlLabel
              control={
                <Checkbox
                  checked={isTraveller}
                  onChange={handleTravellerChange}
                  disabled={isHost} // Disable traveller if host is selected
                />
              }
              label="Traveller"
            />
            <Typography variant="body1">Or</Typography>
            <FormControlLabel
              control={
                <Checkbox
                  checked={isHost}
                  onChange={handleHostChange}
                  disabled={isTraveller} // Disable host if traveller is selected
                />
              }
              label="Host"
            />
          </div>

          <Button
            className="signup-button"
            fullWidth
            variant="contained"
            onClick={handleRegister}
          >
            Create account
          </Button>

          {message && (
            <div className="form-group">
              <div
                className={
                  successful ? "alert alert-success" : "alert alert-danger"
                }
                role="alert"
              >
                {message}
              </div>
            </div>
          )}

          <Typography
            variant="body2"
            style={{ marginTop: "1em", textAlign: "center" }}
          >
            Existing user?{" "}
            <Link href="/login" underline="none">
              Login
            </Link>
          </Typography>
        </div>
      </Container>
    </div>
  );
};

export default SignUp;
